import React from 'react';
import { useNavigate } from 'react-router-dom';

const Calendar: React.FC = () => {
  const navigate = useNavigate();

  React.useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
    }
  }, [navigate]);

  return (
    <div>
      <h1>CALENDARIO</h1>
      {/* Contenido del Calendario */}
    </div>
  );
};

export default Calendar;
